import './App.css';
import ChatView from './Components/ChatScreen/ChatView';
import SideBar from './Components/SideBar/SideBar';
import {Route, Redirect, Routes, useLocation} from "react-router-dom";

function App() {
  return (
    <div className="App">


      <Route exact path="/id">
        <SideBar/>
        <ChatView/>
      </Route>
      <Route exact path="/">
        <SideBar/>
      </Route>


    </div>
  );
}

export default App;
